import React from "react";
import { Link } from "react-router-dom";
import logo from '../../images/logo.png'
import './index.css';

const Footer = () => {
    const scrollToTop = () => {
        window.scrollTo({
            top: 0, 
            behavior: 'smooth'
          });
    }
    return (
<footer>
   <div class="content">
     <div class="left box">
       <div class="upper">
         <div class="topic">About us</div>
         <p>CodingLab is a channel where you can learn HTML,
         CSS, and also JavaScript along with creative CSS Animations and Effects.</p>
       </div>
       <div class="lower">
         <div class="topic">Contact us</div>
         <div class="phone">
           <a href="#"><i class="fas fa-phone-volume"></i>+007 9089 6767</a>
         </div>
         <div class="email">
           <a href="#"><i class="fas fa-envelope"></i>abc@gmail.com</a>
         </div>
       </div>
     </div>
     <div class="middle box">
       <div class="topic">Our Services</div>
       <div><a href="#">Web Design, Development</a></div>
       <div><a href="#">Web UX Design, Reasearch</a></div>
       <div><a href="#">Web User Interface Design</a></div>
       <div><a href="#">Theme Development, Design</a></div>
       <div><a href="#">Mobile Application Design</a></div>
       <div><a href="#">Wire raming & Prototyping</a></div>
     </div>
     <div class="right box">
       <div class="topic">Subscribe us</div>
       <form action="#">
         <input type="text" placeholder="Enter email address"/>
         <input type="submit" name="" value="Send"/>
         <div class="media-icons">
           <a href="#"><i class="fab fa-facebook-f"></i></a>
           <a href="#"><i class="fab fa-instagram"></i></a>
           <a href="#"><i class="fab fa-twitter"></i></a>
           <a href="#"><i class="fab fa-youtube"></i></a>
           <a href="#"><i class="fab fa-linkedin-in"></i></a>
         </div>
       </form>
     </div>
   </div>
   <div class="bottom">
     <p>Copyright © 2020 <a href="#">CodingLab</a> All rights reserved</p>
   </div>
 </footer>
        // <footer>
        //     <div className="footer-container">
        //         <div className="footer-left">
        //             <div className="navigation">
        //                 <a className="main" onClick={scrollToTop}>
        //                     <Link to="/" className="nav-logo">
        //                     <img className="codeOverflow-logo-img" src={logo} alt="codeOverflow" />
        //                     <h1 className="codeOverflow-logo-text-footer">codeOverflow</h1>
        //                     </Link>
        //                 </a>
        //                 <ul> 
        //                     <Link to="/questions">
        //                         <li>FAQ</li>
        //                     </Link>
        //                     <a href="https://stackoverflow.com/help" target="_blank">
        //                         <li>Help</li>
        //                     </a>
        //                 </ul>
        //             </div>
        //         </div>
        //         <div className="footer-right">
        //             <div className="navigation">
        //                 <ul>
        //                     <a href="" target="_blank">
        //                         <li>Github</li>
        //                     </a>
        //                     <a href="" target="_blank">
        //                         <li>LinkedIn</li>
        //                     </a>
        //                     <a href="" target="_blank">
        //                         <li>Twitter</li>
        //                     </a>
        //                 </ul>
        //             </div>
        //         </div>
        //     </div>
        // </footer>
    )
}

export default Footer;
